ng long combi(int n,int r)
{
  int i,j,k,q;
  long long product;

  for(i=n;i>n-r;i--)
    number[i]=i;

  for(i=r;i>=2;i--)
    {
      q=i;
      for(k=0;k<sizeof(primes)/sizeof(int);k++)
	{
	  if((q % primes[k])==0)
	    {
	      for(j=n;j>n-r;j--)
		{
		  if((number[j] % primes[k])==0)
		    {
		      number[j]/=primes[k];
		      goto NEXT;
		    }
		}
	    NEXT:
	      q /= primes[k];
	    }
	}
      if(q>1)
	for(j=n;j>n-r;j--)
	  {
	    if((number[j] % q)==0)
	      {
		number[j]/=q;
		break;
	      }
	  }
    }  

  product=1LL;

  for(i=n;i>n-r;i--)
    {
    product *= number[i];
    //printf("%d:",number[i]);
    product = product % 100000007;
    }

  return(product);
}
